                 // \u53ef\u4ee5TP\uff0cnext\u66f4\u65b0\u4e3a\u4e0b\u4e2a\u5730\u5740, \u800c\u4e14\u4e0d\u589e\u52a0\u6b65\u6570\n                    next = graph[next];\n                }\n                if (visited.count(next) == 1) continue;  // \u4e0d\u8d70\u91cd\u590d\u8def\n\n                // cout << cur << " " << next << endl;\n                queue.push_back({next, step + 1});\n                visited.insert(next);\n            }\n        }\n        return -1;\n    }\n};\n')))}d.isMDXComponent=!0}}]);